public class Solution {
    public int MissingInteger(int[] nums) {
        // Base case: if the first element isn't 1, return 1 (assuming the sum of an empty prefix is considered 0)
        if (nums[0] != 1) return 1;

        // Find the length of the longest sequential prefix
        int maxLength = 1;
        for (int i = 1; i < nums.Length; i++) {
            if (nums[i] == nums[i - 1] + 1) {
                maxLength++;
            } else {
                break; // Exit the loop when the sequence breaks
            }
        }

        // Calculate the sum of the longest sequential prefix
        int sum = (nums[0] + nums[0] + maxLength - 1) * maxLength / 2;

        // Find the smallest missing integer greater than or equal to the sum
        int missing = sum;
        while (true) {
            bool found = false;
            for (int i = 0; i < nums.Length; i++) {
                if (nums[i] == missing) {
                    found = true;
                    break;
                }
            }
            if (!found) return missing; // If missing is not found in nums, return it
            missing++; // Otherwise, increment missing and check the next integer
        }
    }
}
